import React, { Component } from 'react';
import './App.css';
import * as d3 from 'd3'

class App extends Component {
  componentDidMount() {
    d3.dsv(",\u0020", "data/weekly_in_situ_co2_mlo.csv").then(function(data) {
      console.log(data[0])
    })
  }
  render() {
    return (
      <div className="App">
      </div>
    )
  }
}

export default App;
